# Explanation of solution

The logic is simple. If the number is 0 or 1, we just return it. Otherwise, we take the rightmost bit, which is the bit that has been left unset, and return it.

We then take the number and shift it one bit to the right, effectively taking away the rightmost bit. Then, we return the number we just created, along with the original bit that was left unset.

This solution passes all tests, and it is concise and easy to understand.

